import styled from "styled-components";

import Header from "../Header";

const StyledOnline = styled.div`
  width: 100%;
`;

const Online = ({}) => {
  return (
    <StyledOnline>
      <Header>
        <p
          style={{
            fontSize: "16px",
            fontWeight: 700,
            letterSpacing: "2px",
            textAlign: "center",
          }}
        >
          ONLINE (7)
        </p>
      </Header>
    </StyledOnline>
  );
};

export default Online;
